import React from 'react';
import Card from './Card';
import Sdata from './Sdata';


const App = () => (
    <>
    {Sdata.map((value) =>{
        return(
        <Card 
        key={value.id}
        imagesrc={value.imagesrc}
        title={value.title}
        sname={value.sname}
        link={value.link} 
        />
        );

    })}
        </>
);
